import React from 'react';
import { useTranslation } from 'react-i18next';

const Projects: React.FC = () => {
  const { t } = useTranslation();

  const projects = [
    {
      title: 'E-Commerce Platform',
      description: 'Plataforma de comercio electr√≥nico completa con pasarela de pagos, gesti√≥n de inventario y panel de administraci√≥n.',
      image: 'üõí',
      technologies: ['React', 'Node.js', 'MongoDB', 'Stripe'],
      liveUrl: 'https://demo-ecommerce.com',
      codeUrl: 'https://github.com/usuario/ecommerce'
    },
    {
      title: 'Task Management System',
      description: 'Sistema de gesti√≥n de tareas con colaboraci√≥n en tiempo real, notificaciones y an√°lisis de productividad.',
      image: 'üìã',
      technologies: ['Vue.js', 'Python', 'PostgreSQL', 'Socket.io'],
      liveUrl: 'https://demo-tasks.com',
      codeUrl: 'https://github.com/usuario/task-manager'
    },
    {
      title: 'Weather Analytics Dashboard',
      description: 'Dashboard anal√≠tico para visualizaci√≥n de datos meteorol√≥gicos con predicciones y mapas interactivos.',
      image: 'üå§Ô∏è',
      technologies: ['React', 'D3.js', 'Express', 'Weather API'],
      liveUrl: 'https://demo-weather.com',
      codeUrl: 'https://github.com/usuario/weather-dashboard'
    },
    {
      title: 'Portfolio Website',
      description: 'Sitio web portfolio personal con dise√±o responsivo y optimizaci√≥n SEO.',
      image: 'üé®',
      technologies: ['Next.js', 'TypeScript', 'Tailwind CSS', 'Framer Motion'],
      liveUrl: 'https://demo-portfolio.com',
      codeUrl: 'https://github.com/usuario/portfolio'
    }
  ];

  return (
    <section id="projects" className="section">
      <div className="animate-fade-in-up">
        <h2 className="section-title font-cinzel">
          {t('projects.title')}
        </h2>

        <div className="grid grid-2">
          {projects.map((project, index) => (
            <div 
              key={index}
              className="card animate-fade-in-up"
              style={{ 
                animationDelay: `${index * 0.1}s`,
                position: 'relative',
                overflow: 'hidden'
              }}
            >
              {/* Imagen/Icono del proyecto */}
              <div style={{
                width: '100%',
                height: '200px',
                background: 'var(--gradient-accent)',
                borderRadius: '8px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '4rem',
                marginBottom: '1.5rem',
                position: 'relative',
                overflow: 'hidden'
              }}>
                {project.image}
                <div style={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  right: 0,
                  bottom: 0,
                  background: 'linear-gradient(45deg, rgba(0,0,0,0.2) 0%, rgba(255,255,255,0.1) 100%)',
                  opacity: 0,
                  transition: 'opacity 0.3s ease'
                }} className="project-overlay" />
              </div>

              <div>
                <h3 className="font-playfair" style={{
                  color: 'var(--accent-primary)',
                  fontSize: '1.4rem',
                  marginBottom: '1rem'
                }}>
                  {project.title}
                </h3>

                <p style={{
                  marginBottom: '1.5rem',
                  lineHeight: '1.6',
                  color: 'var(--text-secondary)'
                }}>
                  {project.description}
                </p>

                {/* Tecnolog√≠as */}
                <div style={{
                  display: 'flex',
                  flexWrap: 'wrap',
                  gap: '0.5rem',
                  marginBottom: '1.5rem'
                }}>
                  {project.technologies.map((tech, techIndex) => (
                    <span 
                      key={techIndex}
                      style={{
                        background: 'var(--bg-tertiary)',
                        color: 'var(--text-primary)',
                        padding: '0.25rem 0.75rem',
                        borderRadius: '12px',
                        fontSize: '0.8rem',
                        border: '1px solid var(--border-color)'
                      }}
                    >
                      {tech}
                    </span>
                  ))}
                </div>

                {/* Botones de acci√≥n */}
                <div style={{
                  display: 'flex',
                  gap: '1rem',
                  justifyContent: 'space-between'
                }}>
                  <a
                    href={project.liveUrl}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="btn"
                    style={{
                      flex: 1,
                      textAlign: 'center',
                      textDecoration: 'none',
                      fontSize: '0.9rem',
                      padding: '0.75rem 1rem'
                    }}
                  >
                    {t('projects.viewProject')}
                  </a>
                  <a
                    href={project.codeUrl}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="btn btn-outline"
                    style={{
                      flex: 1,
                      textAlign: 'center',
                      textDecoration: 'none',
                      fontSize: '0.9rem',
                      padding: '0.75rem 1rem'
                    }}
                  >
                    {t('projects.viewCode')}
                  </a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      <style>{`
        .card:hover .project-overlay {
          opacity: 1;
        }
      `}</style>
    </section>
  );
};

export default Projects;
